INSERT INTO `weapon` (`id`, `name`, `deskripsi`, `harga`, `image`, `uploaded`, `link`) VALUES
(9, 'AWP | Neo-Noir', 'High risk and high reward, the infamous AWP is recognizable by its signature report and one-shot, one-kill policy. It has been custom painted with two stylized blue-magenta women over a grayscale background. \"They took comfort in each others despair\"\r\n \r\nThe Danger Zone Collection', '305.000', , '2021-11-28', 'https://steamcommunity.com/market/search?q=neo-noir&category_730_ItemSet%5B%5D=any&category_730_ProPlayer%5B%5D=any&category_730_StickerCapsule%5B%5D=any&category_730_TournamentTeam%5B%5D=any&category_730_Weapon%5B%5D=tag_weapon_awp&appid=730#p1_price_asc');
INSERT INTO `weapon` (`id`, `name`, `deskripsi`, `harga`, `image`, `uploaded`, `link`) VALUES
