INSERT INTO `weapon` (`id`, `name`, `deskripsi`, `harga`, `image`, `uploaded`, `link`) VALUES
(11, 'Glock-18 | Neo-Noir', 'The Glock 18 is a serviceable first-round pistol that works best against unarmored opponents and is capable of firing three-round bursts. It has been custom painted with a stylized blue-magenta woman over a grayscale background. \"Things were starting to turn and she began to feel hope—then she looked up\"\r\n \r\nThe Operation Broken Fang Collection', '64.000', , '2021-11-28', 'https://steamcommunity.com/market/search?q=neo-noir&category_730_ItemSet%5B%5D=any&category_730_ProPlayer%5B%5D=any&category_730_StickerCapsule%5B%5D=any&category_730_TournamentTeam%5B%5D=any&category_730_Weapon%5B%5D=tag_weapon_glock&appid=730#p1_price_asc');
INSERT INTO `weapon` (`id`, `name`, `deskripsi`, `harga`, `image`, `uploaded`, `link`) VALUES
